import React from 'react';
import './App.css';
import Footer from './components/footer/Footer';
import Header from './components/header/Header';
import Operators from './components/operators/Operators';
import {BrowserRouter, Route, Switch} from 'react-router-dom';
import CheckList from './components/Check/CheckList';

function App(props) {
  let Oper = props.listOperators.map(id => <CheckList name={id.name} id = {id.id} />)
    return (
      <BrowserRouter>
        <div className="app__wrapper">
          <Header />
          <Route exact path="/main" component={Operators} />
          <Switch>
            <Route
              exact
              path="/checklist/1"
              render={() => <CheckList content={Oper.name[0]} />}
            />
            <Route
              exact
              path="/checklist/2"
              render={() => <CheckList content="Мегафон" />}
            />
            <Route
              exact
              path="/checklist/3"
              render={() => <CheckList content="Билайн" />}
            />
          </Switch>
          <Footer />
        </div>
      </BrowserRouter>
    );
}

export default App;
